import React from "react";
import "./pagination.css";

export const Pagination = ({pageNumbers}) => {
    console.log(pageNumbers);
    return (
        <div className="wrapper">
            <ul className="pagination">
                <li className="disabled"><a href="#!">
                    <i className="material-icons">chevron_left</i></a>
                </li>

                <li className="active"><a href="#!">1</a></li>
                <li className="waves-effect"><a href="#!">2</a></li>
                <li className="waves-effect"><a href="#!">3</a></li>
                <li className="waves-effect"><a href="#!">4</a></li>
                <li className="waves-effect"><a href="#!">5</a></li>
                <li className="waves-effect"><a href="#!">6</a></li>
                <li className="waves-effect"><a href="#!">7</a></li>
                <li className="waves-effect"><a href="#!">8</a></li>
                <li className="waves-effect"><a href="#!">9</a></li>
                <li className="waves-effect"><a href="#!">10</a></li>

                {pageNumbers.map(page => {
                    <li className="waves-effect"><a href="#!">2</a></li>
                })}

                <li className="waves-effect"><a href="#!">
                    <i className="material-icons">chevron_right</i></a>
                </li>
            </ul>
        </div>
    )
};
